     let addr = drawsocket.oscprefix+'/readybutton';
     msg[addr] = 0;
     drawsocket.send(msg);

val.onclick:
drawsocket.startAudio();
let msg = {};
let addr = drawsocket.oscprefix+'/readybutton/state';
if( !this.classList.contains('ready') )
{
   this.classList.add('ready');
   msg[addr] = 1;
   drawsocket.send(msg);
} else { 
   this.classList.remove('ready');
   msg[addr] = 0;
   drawsocket.send(msg);
}

if( !this.classList.contains('ready') )
{
   this.classList.add('ready');
   drawsocket.input({
     key: 'tween',
     val: [ {
       id: 'score-anim',
  		   cmd : 'play'
     }, {
       id: 'miniscore-anim',
  		   cmd : 'play'
     } ],
     timetag: Date.now()
   });
} else { 
   this.classList.remove('ready');
   drawsocket.input({
     key: 'tween',
     val: [{
       id: 'score-anim',
  		   cmd : 'reset'
     }, {
       id: 'miniscore-anim',
  		   cmd : 'reset'
     }]
   });
}

